use strict;
use warnings;

use Text::CSV;
use Data::Dumper;
use Meteodata::Storage::DbConnection;

my $db = Meteodata::Storage::DbConnection->new(
	table => 'stations',
	user => 'cassandra',
	host => 'localhost',
	keyspace => 'meteodata',
);

my %data;

print "Connected? \n";
$db->connect('cassandra');
my @columns = split /\s*,\s*/,q(Id, Now, Bar Trend,Barometer, Absolute Barometric Pressure,Barometric Sensor Raw Reading, Inside Temperature,Outside Temperature, Inside Humidity,Outside Humidity, Extra Temperatures, Soil Temperature,  Leaf Temperature, Extra Humidities, Soil Moistures, Leaf Wetnesses, Wind Speed, Wind Direction, 10-Min Avg Wind Speed, 2-Min Avg Wind Speed, 10-Min Wind Gust, Wind Direction for the 10-Min Wind Gust, Rain Rate, Last 15-min Rain, Last Hour Rain, Last 24-Hour Rain, Day Rain, Month Rain, Year Rain, Storm Rain, Start Date of Current Storm, UV, Solar Radiation, Dew Point, Heat Index, Wind Chill, THSW Index, Day ET, Month ET, Year ET, Forecast, Forecast Icons, Time Sunrise, Time Sunset, Altimeter Setting, Barometric Reduction Method, Barometric calibration number, User-entered Barometric Offset, Transmitter Battery Status, Console Battery Voltage);

$db->discover_stations;
my $csv = Text::CSV->new({sep_char => q(;)}) or die "Cannot use CSV: ".Text::CSV->error_diag ();
$csv->column_names(@columns);
while (my $row = $csv->getline_hr(*DATA)) {
	# print Dumper(%$row);
	#tweak the data, some fields must be arrays
	$row->{'Extra Temperatures'} = ['NULL','NULL','NULL','NULL','NULL','NULL','NULL']; # or something like split /,/,$row->{'Extra Temperatures'}
	$row->{'Extra Humidities'} = ['NULL','NULL','NULL','NULL','NULL','NULL','NULL'];
	$row->{'Soil Temperature'} = ['NULL','NULL','NULL','NULL'];
	$row->{'Leaf Temperature'} = ['NULL','NULL','NULL','NULL'];
	$row->{'Soil Moistures'} = ['NULL','NULL','NULL','NULL'];
	$row->{'Leaf Wetnesses'} = ['NULL','NULL','NULL','NULL'];
	#	print Dumper($row);
	$db->add_new_data($row->{'Id'},$row);
	sleep 3;
}

